@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {

}
<ul class="nav nav-pills">
  <li class="nav-item">
    <a class="nav-link" [routerLink]="'/'" routerLinkActive="active"
      >Star Wars Characters</a
    >
  </li>
  <li class="nav-item">
    <a class="nav-link" [routerLink]="'new-character'" routerLinkActive="active"
      >New Character</a
    >
  </li>
</ul>
